func lengthOfLongestSubstring(s string) int {
	// Initialize a map to store characters and their last seen indices.
	charMap := make(map[byte]int)

	// Initialize variables to keep track of the starting index of the current substring and the maximum length.
	start := 0
	maxLength := 0

	for end := 0; end < len(s); end++ {
		// If the character is already present in the map and its last seen index is greater than or equal to the start index,
		// update the start index to the next position of the repeating character.
		if lastSeenIndex, found := charMap[s[end]]; found && lastSeenIndex >= start {
			start = lastSeenIndex + 1
		}

		// Update the last seen index of the character.
		charMap[s[end]] = end

		// Calculate the current substring length and update maxLength if needed.
		currentLength := end - start + 1
		if currentLength > maxLength {
			maxLength = currentLength
		}

		fmt.Println(charMap)
	}

	return maxLength
}
